import React from "react";

function Admissions() {
  return (
    <div>
        <div className="container">
        <div className="content">
          <h1>Welcome to National Public School, Shivpura.</h1>
          <p>We are an educational institution that prepares students for a rapidly changing world by nurturing the required skill sets, instilling a global perspective and inculcating core values of respect, honesty, loyalty, perseverance and compassion.


Admission to National Public School, Shivapura, is open to all children from Montessori (I-5 Academy), Pre-K, Kindergarten and Classes 1 to 9 & 10.
</p>
        </div>
        </div>

        <div className="container">
        <div className="content">
          <h1></h1>
          </div>
        </div>
    </div>
  );
}

export default Admissions;
